// import './style.css';
import WhiteBox from '../../components/whitebox/whitebox';
import { FixtureBox } from '../../components/fixturebox/fixturebox';
import GameBox from '../../components/gamebox/gamebox';

const games = [
  {
    id: 1,
    team1: "SIS",
    team2: "KIS",
    score1: 2,
    score2: 0,
    livetext: "LIVE"
  }
]

function Content() {
  return (
    <div>
      {games.map(game => {
        console.log(game)
        return (
          <GameBox id={game.id} team1={game.team1} team2={game.team2} score1={game.score1} score2={game.score2} livetext={game.livetext} />
        );
      })
      }
    </div>
  );
}

function Home() {
  return (
    <div>
      <FixtureBox title="Fixtures" />
    </div>
  );
}

export default Home;
